    false,nt"url": null,nt"notes": "This document discusses the proposed expansion
    of the Service's easement program for protection of the wildlife habitat of Merced
    County's Grasslands Ecological Area. The purpose of the proposed action is to 1)
    expand protection and management of the existing Grasslands Wildlife Management
    Area to include key habitats for migratory waterfowl, shorebirds, landbirds, and
    several endangered, threatened species; 2) maintain the high biological diversity
    of Merced County's native grasslands, and vernal pools; and 3) establish a protection
